In &quot;Run Mummy Run&quot; you control a terrified mummy trying to find its way back to the pharaohs tomb. Duck, jump, collect coins and don't let the humans get to you! Run through three amazing locations and gather as many points as you can!
-3 scenarios with unique graphics
-18 levels with increasing difficulty
-Endless playtime in the survival mode
-Ducking, jumping and double jumping mechanics
-Power-ups
-Achievements

